function Forecast({ forecast }) {

  return (
    <div className="forecast__container">
        {forecast.currentForecast.day}
        {forecast.currentForecast.date}
        {forecast.currentForecast.temp}
        {forecast.currentForecast.location}
        {forecast.currentForecast.icon}
        {forecast.currentForecast.description}
    </div>
  )
}

export default Forecast;
